import React from "react"

const Header = () => {
    return (
        <div class="header">
            <ul>
                <li class="active"><a href=""><i class="icon fas fa-shipping-fast"></i>MY MOVES</a></li>
                <li><a href=""><i class="icon fas fa-user-alt"></i> MY PROFILE</a></li>
                <li><a href=""><i class="icon fas fa-qrcode"></i> GET QUOTE</a></li>
                <li><a href=""><i class="icon fas fa-sign-out-alt"></i> LOGOUT</a></li>
            </ul>
        </div>
    )
}

export default Header;
